import React from "react";
import styled from "styled-components";

const FooterEach = styled.div`
  width: 100%;
  height: 56px;
  margin : 0px;
  background-color: white;
  display : flex;
  align-items: center;
  justify-content: flex-start;
`;

const Footer = (props) => {
  return (
    <>
      <FooterEach>
      </FooterEach>
    </>
  );
};

export default Footer;
